import Link from "next/link";

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>노드버드</a>{" "}
        </Link>
        <Link href="/profile">프로필</Link>
        <Link href="/signup">회원가입</Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.protoTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
